	chrome.extension.onConnect.addListener(function( port ){				
		
		var pendingRequestLastId = 0;
		var pendingRequests = {};
		
		function addRequest( message, callback ){
			var requestId = pendingRequestLastId;
			pendingRequestLastId++;
			
			message.requestId = requestId;
			
			pendingRequests[ requestId ] = callback;
						
			port.postMessage( message );
		}
		
		function downloadMediaItemRequest( media ){
			
			port.postMessage( {
				action: "download",
				media: media
			} );
			
		}
		
		function getOffset( obj ) {
			var curleft = curtop = 0;
			if (obj.offsetParent) {
				do {
					curleft += obj.offsetLeft;
					curtop += obj.offsetTop;
				}
				while(obj = obj.offsetParent);
			}
			
			
			
			return {
				"left": curleft,
				"top": curtop
			};
		}
	
	
		port.onMessage.addListener( function( message ){
									
			switch( message.action ){
								
				case "show_Div":
				
					curLink = message.url;
					curHost = message.host;
					show_Div( message.safe, message.live );	
					
				break;
				
				case "setWOT":
					
					set_WOT( message.status );

				break;

				case "setMcAfee":
					
					set_McAfee( message.status );

				break;

				case "setNorton":
					
					set_Norton( message.status );

				break;

				case "setGoogle":
					
					set_Google( message.status, message.msg, message.u);

				break;

				case "setAvast":
					
					set_Avast( message.status );

				break;

				case "setTrust":
					
					set_Trust( message.status, message.msg );

				break;

				case "setDrWeb":
					
					serviseLink = message.url;
					set_DrWeb( message.status );

				break;

				case "contextMenu":
					
					showPreviewContext( message.url, message.host );
				
				break;
				
				case "show_Div_Safe":
					
					showDivSafe( message.url, message.host, message.x, message.y );
				
				break;

				
				case "LivePreview_frame":

					showLivePreview( message.url );

				break;
				
			}
			
		} );

		
	});
	
